// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract PaymentsContract {
    uint256 public constant price = 10**18;
    address public owner;

    mapping(address => string) private userSubscriptionList; // gettind data via getUserSubscriptionData
    mapping(address => bool) private excludedAccount;

    modifier onlyOwner() {
        require(owner == msg.sender, "Access denied. Only for owner.");
        _;
    }

    event Payment(string _timestamp, address _from, uint256 _value);

    constructor() public {
        owner = msg.sender;
    }

    function getUserSubscriptionData()
        public
        view
        returns (string memory, bool)
    {
        string memory paymentTimestamp = userSubscriptionList[msg.sender];
        bool excluded = excludedAccount[msg.sender];
        return (paymentTimestamp, excluded);
    }

    function payment(string calldata _timestamp) external payable {
        require(msg.value == price, "unpermitted payment value");
        userSubscriptionList[msg.sender] = _timestamp;
        emit Payment(_timestamp, msg.sender, msg.value);
    }

    function addToExcluded(address _address) external onlyOwner {
        excludedAccount[_address] = true;
    }
}
